import styled from "styled-components";

export const FileSearchBar = styled("input")`
    text-align: center;
`

export const FileSearchButton = styled("button")`
    border-radius: 0.5rem;
    text-align: center;
    width: 5rem;
`

export const SearchWrapper = styled("div")`
    width:80vh;
    margin:auto;
    justify-items: center;
    justify-content: center;
    text-align: center;
`

export const FilterDateInput = styled("input")`
    width: 5rem;
    text-align: center;
    margin: auto;
`

export const FiltersWrapper = styled("div")`
    height:5vh;
    display: flex;
    flex-direction: row;
    justify-content: space-evenly;
`

export const ListAndFilterContainer = styled("div")`
    display: flex;
    flex-direction: column;
    overflow: scroll;
    ::-webkit-scrollbar {
    width: 0px;
    background: transparent; /* make scrollbar transparent */
}
`

export const LogMasterDetailContainer = styled("div")`
    display:flex;
    flex-direction: row;
    color:white;
    margin: 1rem;


`
